import React, { Component } from 'react';
import '../img/coin.png';

class Coin extends React.Component {
  render() {
    return (
      <img
        className={this.props.class}
        src="../img/coin.png"
        alt="bitcoin image"
      />
    );
  }
}
export default Coin;
